import '../../App.css';

function Test() {
    return (
        <div className="area"> 
    <div className="grid-container">
     <div className="area-grid">  
    <div className="grid-item-img"> 
    1111
    </div>
    <div className="grid-item-text">
    <img src="images/img-1.j" alt="Girl in a jacket" width="100%" height="auto" />



    </div>
    
     </div> 
     </div>
</div>

    );
  }
  
  export default Test;
